import Navbar from "./community board/components/navbar/Navbar";
import Footer from "./community board/components/footer/Footer";
import React from 'react';
import Community from "./community board/components/Community";
import { useState, createContext,Router, Route } from "react";
import * as Unicons from '@iconscout/react-unicons';
import Chat from './Chat/Chat';
import Join from './Join/Join';




function App() {
  return (
    
    <div>
        <Router>
      <Route path="/" exact component={Join} />
      <Route path="/chat" component={Chat} />
    </Router>
      <Unicons.UilReact />
      <Navbar />
      <div><Community /></div>
      <div>
        <Footer />
      </div>
    </div>
  )
}



export default App;
